export default function Navbar(){
    return(
        <div class="navbar">
        <ul>
          <li><a>Home</a></li>
          <li><a>Skills</a></li>
          <li><a>Projects</a></li>
          <li><a>Contact</a></li>
        </ul>
      </div>
    );
}
